metadata.description:
Tesla Sculptures() is a generative art project inspired by Nikola Tesla's Code of Creation, the one that embeds reality and turns it into something tangible;
Each Sculpture is created from a 9 by 9 grid in which every position has assigned a random number between 0 and 360 (a significant number in this Code);
The sculpture is built colouring only the positions of the grid whose digital root is equal to 3, 6 or 9, having each one of these three numbers a colour assigned;
The idea behind this project is the concept of the creation from scratch of something tangible, thus representing the duality of the number 9, going from nothing to everything and also manifesting the balance of this creation represented by the number 3 and the number 6.

As a thank you for their support, I have named three colour palettes used in this project with the name of the three collectors who minted my first project 'NFTT': Recipe Morado, Sthersky and Anonymous First Buyer;

If you want to know more about Tesla's Code of Creation, visit my website:  http://petaura.art/Tesla_Sculptures.html
